import React, {Component} from 'react';
import Todo from "../Todo/Todo";
import PropTypes from 'prop-types'
import './LIst.css'
class List extends Component {
    static propTypes ={
        todos:PropTypes.array.isRequired,
        Up_data_todos:PropTypes.func.isRequired,
        delete_todo:PropTypes.func.isRequired
    }
    render() {
        const {Up_data_todos,todos,delete_todo}=this.props
        return (
            <ul className="todo-main">
                {
                    todos.map(todo=>{
                        return <Todo key={todo.id} {...todo} Up_data_todos={Up_data_todos} delete_todo={delete_todo} />
                    })
                }
            </ul>
        );
    }
}

export default List;
